INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (787, 118501, 0, 0, 118501, 37, 0, 2, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", "かりん", 0, 2.0, 118501, "カリン", 118501, "2021/10/19 12:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 37);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (826, 118601, 0, 0, 118601, 0, 0, 2, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", "ねびあ", 0, 2.0, 118601, "ネビア", 118601, "2024/08/10 21:00:00", "2030/12/31 15:00:00", 450, 0, 3, 1, 0, 0, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (714, 119001, 0, 0, 119001, 7, 0, 2, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", "いお", 0, 2.27, 119001, "イオ（ノワール）", 119001, "2021/11/03 19:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 15, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (143, 119101, 0, 0, 119101, 26, 0, 2, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", "くうか", 0, 2.545, 119101, "クウカ（ノワール）", 119101, "2021/11/16 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 12, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (397, 119201, 0, 0, 119201, 6, 0, 1, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", "まひる", 0, 2.19, 119201, "マヒル（クリスマス）", 119201, "2023/09/19 15:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 5, 6);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (762, 119301, 0, 0, 119301, 8, 0, 1, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", "りの", 0, 1.97, 119301, "リノ（クリスマス）", 119301, "2021/12/22 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 6, 8);
