INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (190, 120001, 0, 0, 120001, 5, 0, 1, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", "しずる", 0, 2.375, 120001, "シズル（ノワール）", 120001, "2024/03/22 12:00:00", "2024/03/28 11:59:59", 450, 0, 3, 1, 0, 6, 5);
