INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (283, 120701, 0, 0, 120701, 22, 0, 1, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", "しぇふぃ", 0, 1.84, 120701, "シェフィ（ニューイヤー）", 120701, "2024/01/26 12:00:00", "2024/01/31 11:59:59", 450, 0, 3, 1, 0, 1, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (193, 120801, 0, 0, 120801, 22, 0, 1, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", "るか", 0, 1.3, 120801, "ルカ（ニューイヤー）", 120801, "2023/10/16 15:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 2, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (424, 120901, 0, 0, 120901, 38, 0, 2, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", "いりや", 0, 1.425, 120901, "イリヤ（ニューイヤー）", 120901, "2024/01/26 12:00:00", "2024/01/31 11:59:59", 450, 0, 3, 1, 0, 12, 3);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (164, 121001, 0, 0, 121001, 41, 0, 1, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", "ぺこりーぬ", 0, 2.25, 121001, "ペコリーヌ（オーバーロード）", 121001, "2024/02/22 12:00:00", "2024/02/29 11:59:59", 450, 0, 3, 1, 0, 1, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (588, 121101, 0, 0, 121101, 42, 0, 2, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", "きゃる", 0, 2.07, 121101, "キャル（オーバーロード）", 121101, "2024/02/22 12:00:00", "2024/02/29 11:59:59", 450, 0, 3, 1, 0, 1, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (260, 121201, 0, 0, 121201, 40, 0, 1, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", "らびりすた", 0, 1.55, 121201, "ラビリスタ（オーバーロード）", 121201, "2023/11/16 15:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 6, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (731, 121301, 0, 0, 121301, 3, 0, 1, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", "くるみ", 0, 1.9, 121301, "クルミ（ステージ）", 121301, "2022/03/03 19:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 3, 3);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (742, 121401, 0, 0, 121401, 7, 0, 2, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", "みさき", 0, 2.27, 121401, "ミサキ（ステージ）", 121401, "2022/03/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 15, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (590, 121501, 0, 0, 121501, 6, 0, 1, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", "あゆみ", 0, 2.0, 121501, "アユミ（怪盗）", 121501, "2024/04/12 12:00:00", "2024/04/15 14:59:59", 450, 0, 3, 1, 0, 12, 6);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (292, 121601, 0, 0, 121601, 3, 0, 1, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", "いのり", 0, 1.425, 121601, "イノリ（怪盗）", 121601, "2022/04/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 17, 3);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (421, 0, 0, 180901, 121701, 0, 1, 0, "", "あきの", 0, 0.0, 121701, "アキノ（アキノ＆サレン）", 0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 0, 3, 1, 0, 0, 0);
