INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (293, 121901, 0, 0, 121901, 5, 0, 2, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", "あんな", 0, 2.125, 121901, "アンナ（パイレーツ）", 121901, "2022/05/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 12, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (380, 122001, 0, 0, 122001, 3, 0, 1, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", "しのぶ", 0, 1.425, 122001, "シノブ（パイレーツ）", 122001, "2022/05/03 19:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 14, 3);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (731, 122101, 0, 0, 122101, 35, 0, 1, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", "あおい", 0, 1.97, 122101, "アオイ（キャンプ）", 122101, "2024/04/18 15:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 9, 35);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (419, 122201, 0, 0, 122201, 4, 0, 1, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", "ゆかり", 0, 1.84, 122201, "ユカリ（キャンプ）", 122201, "2022/05/31 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 8, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (564, 122301, 0, 0, 122301, 43, 0, 2, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", "うぁんぴぃ", 0, 1.425, 122301, "ヴァンピィ", 122301, "2022/06/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 43);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (264, 122401, 0, 0, 122401, 1, 0, 1, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", "ひより", 0, 2.42, 122401, "ヒヨリ（サマー）", 122401, "2024/06/17 15:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 8, 1);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (250, 122501, 0, 0, 122501, 4, 0, 1, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", "れい", 0, 1.965, 122501, "レイ（サマー）", 122501, "2024/08/26 19:00:00", "2024/08/31 11:59:59", 450, 0, 3, 1, 0, 0, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (554, 122601, 0, 0, 122601, 7, 0, 2, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", "ゆい", 0, 2.27, 122601, "ユイ（サマー）", 122601, "2022/07/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (812, 122701, 0, 0, 122701, 7, 0, 2, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", "きょうか", 0, 1.92, 122701, "キョウカ（サマー）", 122701, "2022/08/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (237, 122801, 0, 0, 122801, 1, 0, 1, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", "みそぎ", 0, 2.295, 122801, "ミソギ（サマー）", 122801, "2024/07/16 15:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 1);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (361, 122901, 0, 0, 122901, 5, 0, 1, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", "みみ", 0, 2.25, 122901, "ミミ（サマー）", 122901, "2024/08/26 19:00:00", "2024/08/31 11:59:59", 450, 0, 3, 1, 0, 0, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (746, 123001, 0, 0, 123001, 44, 0, 2, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", "あめす", 0, 2.27, 123001, "アメス", 123001, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 0, 44);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (793, 123101, 0, 0, 123101, 7, 0, 2, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", "まほ", 0, 1.795, 123101, "マホ（エクスプローラー）", 123101, "2022/09/03 19:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (256, 123201, 0, 0, 123201, 3, 0, 1, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", "あやね", 0, 1.425, 123201, "アヤネ（エクスプローラー）", 123201, "2022/09/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 3);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (350, 123301, 0, 0, 123301, 0, 0, 1, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", "ねあ", 0, 1.62, 123301, "ネア", 123301, "2024/09/25 12:00:00", "2024/09/30 11:59:59", 450, 0, 3, 1, 0, 0, 1);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (0, 0, 0, 0, 123401, 5, 0, 0, "", "じゅん", 0, 0.0, 123401, "ジュン（キャンプ）", 0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 0, 3, 0, 0, 0, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (583, 123501, 0, 0, 123501, 6, 0, 1, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", "りん", 0, 2.34, 123501, "リン（ハロウィン）", 123501, "2024/09/17 15:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 6);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (262, 123601, 0, 0, 123601, 4, 0, 1, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", "とも", 0, 1.965, 123601, "トモ（ハロウィン）", 123601, "2024/10/24 12:00:00", "2024/10/28 11:59:59", 450, 0, 3, 1, 0, 0, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (741, 123701, 0, 0, 123701, 21, 0, 2, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", "ななか", 0, 2.07, 123701, "ナナカ（ハロウィン）", 123701, "2022/10/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (238, 123801, 0, 0, 123801, 1, 0, 1, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", "くりすてぃーな", 0, 2.295, 123801, "クリスティーナ（ワイルド）", 123801, "2024/11/26 12:00:00", "2024/11/30 11:59:59", 450, 0, 3, 1, 0, 0, 1);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (183, 123901, 0, 0, 123901, 2, 0, 1, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", "まつり", 0, 2.125, 123901, "マツリ（ワイルド）", 123901, "2022/11/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 2);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (438, 124001, 0, 0, 124001, 7, 0, 2, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", "あかり", 0, 2.07, 124001, "アカリ（クリスマス）", 124001, "2023/12/11 12:00:00", "2023/12/15 14:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (433, 124101, 0, 0, 124101, 6, 0, 2, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", "より", 0, 1.965, 124101, "ヨリ（クリスマス）", 124101, "2024/11/16 15:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 6);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (144, 124201, 0, 0, 124201, 5, 0, 1, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", "じゅん", 0, 2.07, 124201, "ジュン（クリスマス）", 124201, "2022/12/23 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (577, 0, 0, 181001, 124301, 0, 1, 0, "", "あん", 0, 0.0, 124301, "アン（アン＆グレア）", 0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 0, 3, 1, 0, 0, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (577, 0, 0, 181001, 124401, 0, 1, 0, "", "ぐれあ", 0, 0.0, 124401, "グレア（アン＆グレア）", 0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 0, 3, 1, 0, 0, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (707, 124501, 0, 0, 124501, 21, 0, 2, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", "ほまれ", 0, 2.07, 124501, "ホマレ（ニューイヤー）", 124501, "2024/01/12 12:00:00", "2024/01/15 14:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (698, 124601, 0, 0, 124601, 21, 0, 2, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", "みさと", 0, 2.44, 124601, "ミサト（ニューイヤー）", 124601, "2024/01/12 12:00:00", "2024/01/15 14:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (590, 124701, 0, 0, 124701, 46, 1, 1, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", "みつき", 0, 2.24, 124701, "ミツキ（ニューイヤー）", 124701, "2022/12/31 12:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (423, 124801, 0, 0, 124801, 0, 0, 1, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", "のぞみ", 0, 2.14, 124801, "ノゾミ（リベレイター）", 124801, "2024/02/12 12:00:00", "2024/02/14 23:59:59", 450, 0, 3, 1, 0, 0, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (170, 124901, 0, 0, 124901, 0, 1, 1, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", "かや", 0, 1.965, 124901, "カヤ（リベレイター）", 124901, "2023/01/31 12:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 1);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (221, 125001, 0, 0, 125001, 0, 0, 1, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", "むいみ", 0, 1.965, 125001, "ムイミ（リベレイター）", 125001, "2024/02/12 12:00:00", "2024/02/14 23:59:59", 450, 0, 3, 1, 0, 0, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (825, 125101, 0, 0, 125101, 47, 0, 1, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", "たまき", 0, 2.24, 125101, "タマキ（カフェ）", 125101, "2023/03/03 19:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 8);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (463, 125201, 0, 0, 125201, 4, 0, 1, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", "もにか", 0, 1.965, 125201, "モニカ（カフェ）", 125201, "2023/03/10 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (752, 125301, 0, 0, 125301, 6, 0, 1, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", "こっころ", 0, 2.07, 125301, "コッコロ（レンジャー）", 125301, "2024/04/12 12:00:00", "2024/04/15 14:59:59", 450, 0, 3, 1, 0, 0, 6);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (710, 125401, 0, 0, 125401, 8, 0, 1, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", "しおり", 0, 2.09, 125401, "シオリ（レンジャー）", 125401, "2023/04/10 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 8);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (443, 125501, 0, 0, 125501, 50, 0, 2, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", "じーた", 0, 1.92, 125501, "ジータ（ウォーロック）", 125501, "2024/05/10 12:00:00", "2024/05/15 14:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (267, 125601, 0, 0, 125601, 0, 0, 1, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", "びから", 0, 2.09, 125601, "ビカラ", 125601, "2024/05/10 12:00:00", "2024/05/15 14:59:59", 450, 0, 3, 1, 0, 0, 51);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (579, 125701, 0, 0, 125701, 9, 1, 2, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", "かりん", 0, 2.24, 125701, "カリン（アルケミスト）", 125701, "2023/04/30 12:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (464, 125801, 0, 0, 125801, 0, 0, 1, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", "りり", 0, 2.09, 125801, "リリ（フォールン）", 125801, "2023/04/17 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 3);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (0, 0, 0, 0, 125901, 1, 0, 0, "", "かや", 0, 0.0, 125901, "カヤ（リベレイター）", 0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 0, 3, 1, 0, 0, 1);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (406, 126001, 0, 0, 126001, 0, 0, 1, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", "くりあ", 0, 2.09, 126001, "クリア（フォールン）", 126001, "2023/10/31 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (480, 126101, 0, 0, 126101, 53, 0, 2, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", "ぷれしあ", 0, 2.09, 126101, "プレシア（フォールン）", 126101, "2023/11/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 44);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (568, 126201, 0, 0, 126201, 3, 0, 2, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", "いりや", 0, 2.09, 126201, "イリヤ（儀装束）", 126201, "2024/06/10 12:00:00", "2024/06/15 14:59:59", 450, 0, 3, 1, 0, 0, 3);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (456, 126301, 0, 0, 126301, 9, 0, 2, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", "ゆき", 0, 2.07, 126301, "ユキ（儀装束）", 126301, "2023/06/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (373, 126401, 0, 0, 126401, 1, 0, 1, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", "くろーちぇ", 0, 2.09, 126401, "クローチェ", 126401, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 0, 1);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (740, 126501, 0, 0, 126501, 0, 0, 2, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", "らいらえる", 0, 1.965, 126501, "ライラエル", 126501, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (650, 126601, 0, 0, 126601, 7, 0, 2, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", "ねねか", 0, 2.04, 126601, "ネネカ（サマー）", 126601, "2024/07/11 12:00:00", "2024/07/15 14:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (224, 126701, 0, 0, 126701, 5, 1, 1, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", "あきの", 0, 1.965, 126701, "アキノ（サマー）", 126701, "2023/06/30 12:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (159, 126801, 0, 0, 126801, 5, 0, 1, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", "ゆかり", 0, 1.97, 126801, "ユカリ（サマー）", 126801, "2023/07/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (682, 126901, 0, 0, 126901, 21, 0, 2, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", "らんふぁ", 0, 1.965, 126901, "ランファ（サマー）", 126901, "2024/08/09 12:00:00", "2024/08/12 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (133, 127001, 0, 0, 127001, 52, 1, 1, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", "くうか", 0, 1.97, 127001, "クウカ（サマー）", 127001, "2023/07/31 12:00:00", "2023/08/14 20:59:59", 450, 0, 1, 1, 0, 0, 2);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (255, 127101, 0, 0, 127101, 46, 0, 1, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", "しのぶ", 0, 2.09, 127101, "シノブ（サマー）", 127101, "2024/08/09 12:00:00", "2024/08/12 11:59:59", 450, 0, 3, 1, 0, 0, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (804, 127201, 0, 0, 127201, 7, 0, 2, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", "きゃる", 0, 2.09, 127201, "キャル（編入生）", 127201, "2024/10/10 12:00:00", "2024/10/13 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (750, 127301, 0, 0, 127301, 8, 0, 1, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", "すずな", 0, 2.09, 127301, "スズナ（編入生）", 127301, "2023/09/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 8);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (0, 0, 0, 0, 127401, 1, 0, 0, "", "びから", 0, 0.0, 127401, "ビカラ（コラボ）", 0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 0, 3, 1, 0, 0, 1);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (304, 127501, 0, 0, 127501, 4, 0, 1, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", "されん", 0, 2.09, 127501, "サレン（サラサリア）", 127501, "2024/11/11 12:00:00", "2024/11/18 11:59:59", 450, 0, 3, 1, 0, 0, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (157, 127601, 0, 0, 127601, 4, 0, 1, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", "るか", 0, 1.965, 127601, "ルカ（サラサリア）", 127601, "2023/10/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (693, 127701, 0, 0, 127701, 48, 0, 2, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", "りんど", 0, 1.965, 127701, "リンド", 127701, "2024/10/10 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 6);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (706, 127801, 0, 0, 127801, 47, 0, 2, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", "うるむ", 0, 1.965, 127801, "ヴルム", 127801, "2024/10/18 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (372, 127901, 0, 0, 127901, 5, 0, 2, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", "ぺこりーぬ", 0, 1.965, 127901, "ペコリーヌ（クリスマス）", 127901, "2024/12/09 12:00:00", "2024/12/15 14:59:59", 450, 0, 3, 1, 0, 0, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (723, 128001, 0, 0, 128001, 35, 0, 1, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", "くれじった", 0, 2.09, 128001, "クレジッタ（クリスマス）", 128001, "2023/12/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 35);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (580, 0, 0, 181101, 128101, 0, 1, 0, "", "しずる", 0, 0.0, 128101, "シズル（シズル&リノ）", 0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 0, 3, 1, 0, 0, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (580, 0, 0, 181101, 128201, 0, 1, 0, "", "りの", 0, 0.0, 128201, "リノ（シズル&リノ）", 0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 0, 3, 1, 0, 0, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (191, 128301, 0, 0, 128301, 38, 1, 1, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", "いのり", 0, 2.09, 128301, "イノリ（ニューイヤー）", 128301, "2023/12/31 12:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 3);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (801, 128401, 0, 0, 128401, 21, 0, 2, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", "はつね", 0, 2.09, 128401, "ハツネ（ニューイヤー）", 128401, "2024/06/26 12:00:00", "2024/06/30 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (739, 128501, 0, 0, 128501, 21, 0, 2, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", "かすみ", 0, 2.09, 128501, "カスミ（ニューイヤー）", 128501, "2024/06/26 12:00:00", "2024/06/30 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (0, 0, 0, 0, 128601, 1, 0, 0, "", "りり", 0, 0.0, 128601, "リリ（フォールン）", 0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 0, 3, 1, 0, 0, 1);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (226, 128701, 0, 0, 128701, 0, 0, 1, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", "ひより", 0, 2.09, 128701, "ヒヨリ（アストラル）", 128701, "2024/08/12 12:00:00", "2024/08/15 14:59:59", 450, 0, 3, 1, 0, 0, 1);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (194, 128801, 0, 0, 128801, 0, 1, 1, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", "れい", 0, 1.965, 128801, "レイ（アストラル）", 128801, "2024/01/31 12:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (772, 128901, 0, 0, 128901, 0, 0, 2, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", "ゆい", 0, 2.09, 128901, "ユイ（アストラル）", 128901, "2024/08/12 12:00:00", "2024/08/15 14:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (800, 129001, 0, 0, 129001, 0, 0, 2, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", "えりす", 0, 2.09, 129001, "エリス", 129001, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (708, 129301, 0, 0, 129301, 7, 0, 1, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", "ゆに", 0, 2.09, 129301, "ユニ（ウィンター）", 129301, "2024/09/25 12:00:00", "2024/09/30 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (188, 129401, 0, 0, 129401, 2, 0, 1, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", "くろえ", 0, 2.09, 129401, "クロエ（ウィンター）", 129401, "2024/03/18 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 2);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (550, 129601, 0, 0, 129601, 0, 0, 1, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", "あねもね", 0, 2.09, 129601, "アネモネ", 129601, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 0, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (540, 129701, 0, 0, 129701, 0, 0, 1, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", "ねふぃーねら", 0, 2.09, 129701, "ネフィ＝ネラ", 129701, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 0, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (269, 129801, 0, 0, 129801, 5, 0, 1, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", "まこと", 0, 2.09, 129801, "マコト（コマンダー）", 129801, "2024/10/13 12:00:00", "2024/10/18 11:59:59", 450, 0, 3, 1, 0, 0, 5);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (294, 129901, 0, 0, 129901, 48, 0, 1, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", "えりこ", 0, 1.84, 129901, "エリコ（コマンダー）", 129901, "2024/04/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 6);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (150, 130001, 0, 0, 130001, 0, 0, 1, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", "やまと", 0, 2.09, 130001, "ヤマト", 130001, "2024/11/11 12:00:00", "2024/11/18 11:59:59", 450, 0, 3, 1, 0, 0, 4);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (535, 130101, 0, 0, 130101, 9, 0, 1, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", "わかな", 0, 2.09, 130101, "ワカナ", 130101, "2024/11/18 12:00:00", "2024/11/26 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (371, 130201, 0, 0, 130201, 0, 0, 1, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", "ふぶき", 0, 1.84, 130201, "フブキ", 130201, "2024/10/31 12:00:00", "2024/11/11 11:59:59", 450, 0, 3, 1, 0, 0, 5);
