INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (563, 130701, 0, 0, 130701, 7, 0, 2, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", "きょうか", 0, 1.92, 130701, "キョウカ（スプリング）", 130701, "2024/11/11 12:00:00", "2024/11/18 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (558, 130801, 0, 0, 130801, 7, 0, 2, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", "すずめ", 0, 1.84, 130801, "スズメ（スプリング）", 130801, "2024/05/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (440, 130901, 0, 0, 130901, 7, 0, 2, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", "くるる", 0, 2.09, 130901, "クルル", 130901, "2024/06/15 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 7);
