INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (725, 131901, 0, 0, 131901, 23, 1, 2, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", "えみりあ", 0, 2.09, 131901, "エミリア（サマー）", 131901, "2024/08/31 12:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (775, 132001, 0, 0, 132001, 21, 0, 2, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", "えきどな", 0, 2.09, 132001, "エキドナ（サマー）", 132001, "2024/09/13 12:00:00", "2024/09/25 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (146, 132101, 0, 0, 132101, 24, 0, 1, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", "れむ", 0, 2.09, 132101, "レム（サマー）", 132101, "2024/08/31 12:00:00", "2024/09/13 11:59:59", 450, 0, 3, 1, 0, 0, 13);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (721, 132201, 0, 0, 132201, 7, 0, 2, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", "のぞみ", 0, 1.84, 132201, "ノゾミ（アルケミスト）", 132201, "2024/09/30 12:00:00", "2024/10/10 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (750, 132801, 0, 0, 132801, 0, 0, 2, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", "らいらえる", 0, 2.09, 132801, "ライラエル（クリスマス）", 132801, "2024/11/30 12:00:00", "2024/12/09 11:59:59", 450, 0, 3, 1, 0, 0, 7);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (748, 132901, 0, 0, 132901, 46, 0, 2, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", "いお", 0, 2.09, 132901, "イオ（クリスマス）", 132901, "2024/12/09 12:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 0, 5);
