INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (245, 105701, 0, 0, 170101, 34, 0, 1, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", "じーた", 0, 1.965, 170101, "ジータ", 170101, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 450, 0, 3, 0, 0, 4, 34);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (199, 180101, 0, 0, 180101, 0, 0, 1, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", "ひより", 0, 1.62, 180101, "ヒヨリ（プリンセス）", 180101, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 7, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (767, 180201, 0, 0, 180201, 0, 0, 2, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", "ゆい", 0, 1.92, 180201, "ユイ（プリンセス）", 180201, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 1, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (377, 180301, 0, 0, 180301, 0, 0, 1, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", "れい", 0, 1.965, 180301, "レイ（プリンセス）", 180301, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 7, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (155, 180401, 0, 0, 180401, 0, 0, 1, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", "ぺこりーぬ", 0, 1.965, 180401, "ペコリーヌ（プリンセス）", 180401, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 1, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (555, 180501, 0, 0, 180501, 0, 0, 1, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", "こっころ", 0, 2.14, 180501, "コッコロ（プリンセス）", 180501, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 1, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (747, 180601, 0, 0, 180601, 0, 0, 2, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", "きゃる", 0, 1.92, 180601, "キャル（プリンセス）", 180601, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 1, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (732, 180701, 0, 0, 180701, 0, 0, 1, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", "はつねしおり", 0, 1.75, 180701, "ハツネ＆シオリ", 180701, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 1, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (465, 180801, 0, 0, 180801, 0, 0, 1, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", "みそぎみみきょうか", 0, 1.5, 180801, "ミソギ＆ミミ＆キョウカ", 180801, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 1, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (421, 180901, 0, 0, 180901, 0, 0, 1, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", "あきのされん", 0, 2.09, 180901, "アキノ＆サレン", 180901, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 1, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (577, 181001, 0, 0, 181001, 0, 0, 2, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", "あんぐれあ", 0, 2.09, 181001, "アン＆グレア", 181001, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 1, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (551, 181101, 0, 0, 181101, 0, 0, 1, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", "しずるりの", 0, 1.92, 181101, "シズル＆リノ", 181101, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 1, 0);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (368, 181201, 0, 0, 181201, 0, 0, 1, "【物理】中衛で新たな力と共に再廻する姫装の氷竜少女。\n環境効果【絶氷】でクリティカルダメージを高め、火力と\n手数を併せ持つ剣技で、再び共に歩むため道を切り開く。", "しぇふぃ", 0, 1.92, 181201, "シェフィ（プリンセス）", 181201, "2024/10/28 12:00:00", "2024/10/31 11:59:59", 450, 0, 3, 1, 0, 1, 0);
