INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (850, 191301, 0, 0, 191301, 6, 0, 1, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", "かずまさ", 0, 2.22, 191301, "カズマサ", 191301, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 450, 0, 1, 1, 0, 0, 6);
